Vue.component("inpt",{template:'<div class="input-field col s12"><input :id="name" :name="name" :type="type" class="validate" autocomplete="off"><label :for="name"><slot ref="text"></slot></label></div>',props:{name:{type:String,"default":function(){return this.$refs.text.text().toKebabCase()}},text:[String],type:[String]},methods:{$input:function(a){a=a.srcElement;this.$emit("input",a.options[a.selectedIndex].value)}}});
